import Vue from 'vue'
import VueRouter from 'vue-router'
import PetHome from '../views/PetHome'
import LoginPage from '../views/LoginPage'
import RegisterPage from '../views/RegisterPage'
import HomePage from '../views/HomePage'
import AddPet from '../views/AddPet'
import SocialPage from '../views/SocialPage'
import MainPage from '../views/MainPage'
import PublishPage from '../views/PublishPage'
import UserPage from '../views/UserPage'
Vue.use(VueRouter)
const routes = [
    {
        path: '/',
        name:'PetHome',
        component: PetHome,
    },
    {
        path: '/LoginPage',
        name:'LoginPage',
        component: LoginPage,
    }, 
    {
        path: '/RegisterPage',
        name:'Register',
        component: RegisterPage,
    }, 
    {
        path: '/HomePage',
        name:'HomePage',
        component: HomePage,
    }, 
    {
        path: '/AddPet',
        name:'AddPet',
        component: AddPet,
    }, 
    {
        path: '/SocialPage',
        name:'SocialPage',
        component: SocialPage,
    }, 
    {
        path: '/MainPage',
        name:'MainPage',
        component: MainPage,
    }, 
    {
        path: '/PublishPage',
        name:'PublishPage',
        component: PublishPage,
    }, 
    {
        path: '/UserPage',
        name:'UserPage',
        component: UserPage,
    }, 
    {
        path: '/ManagePet',
        name:'ManagePet',
        component: UserPage,
    }
]

const router = new VueRouter({
    routes
})

export default router
